import React, { useState } from 'react';
import './ProjectList.css';

const ProjectList = ({ projects, onUpdateProject, onDeleteProject, onCreateProject, onBack }) => {
    const [filter, setFilter] = useState('all');
    const [searchTerm, setSearchTerm] = useState('');

    const getProjectStatus = (project) => {
        const today = new Date();
        const startDate = new Date(project.startDate);
        const endDate = new Date(project.endDate);

        if (today < startDate) return 'upcoming';
        if (today > endDate) return 'completed';
        return 'active';
    };

    const filteredProjects = projects.filter(project => {
        const matchesFilter = filter === 'all' || getProjectStatus(project) === filter;
        const matchesSearch = project.projectType.toLowerCase().includes(searchTerm.toLowerCase()) ||
                            (project.projectDescription && project.projectDescription.toLowerCase().includes(searchTerm.toLowerCase()));
        return matchesFilter && matchesSearch;
    });

    const formatDate = (dateStr) => {
        return new Date(dateStr).toLocaleDateString('en-US', {
            year: 'numeric',
            month: 'short',
            day: 'numeric'
        });
    };

    const formatCurrency = (amount) => {
        return new Intl.NumberFormat('en-US', {
            style: 'currency',
            currency: 'USD'
        }).format(amount || 0);
    };

    const getStatusBadge = (project) => {
        const status = getProjectStatus(project);
        const statusClasses = {
            upcoming: 'status-upcoming',
            active: 'status-active',
            completed: 'status-completed'
        };

        return (
            <span className={`status-badge ${statusClasses[status]}`}>
                {status.charAt(0).toUpperCase() + status.slice(1)}
            </span>
        );
    };

    return (
        <div className="project-list">
            <div className="list-header">
                <h2>Project List</h2>
                <div className="header-actions">
                    <button onClick={onCreateProject} className="btn-create">
                        Create New Project
                    </button>
                    <button onClick={onBack} className="btn-back">
                        Back to Dashboard
                    </button>
                </div>
            </div>

            <div className="list-controls">
                <div className="search-box">
                    <input
                        type="text"
                        placeholder="Search projects..."
                        value={searchTerm}
                        onChange={(e) => setSearchTerm(e.target.value)}
                        className="search-input"
                    />
                </div>

                <div className="filter-tabs">
                    <button
                        onClick={() => setFilter('all')}
                        className={`filter-tab ${filter === 'all' ? 'active' : ''}`}
                    >
                        All ({projects.length})
                    </button>
                    <button
                        onClick={() => setFilter('upcoming')}
                        className={`filter-tab ${filter === 'upcoming' ? 'active' : ''}`}
                    >
                        Upcoming ({projects.filter(p => getProjectStatus(p) === 'upcoming').length})
                    </button>
                    <button
                        onClick={() => setFilter('active')}
                        className={`filter-tab ${filter === 'active' ? 'active' : ''}`}
                    >
                        Active ({projects.filter(p => getProjectStatus(p) === 'active').length})
                    </button>
                    <button
                        onClick={() => setFilter('completed')}
                        className={`filter-tab ${filter === 'completed' ? 'active' : ''}`}
                    >
                        Completed ({projects.filter(p => getProjectStatus(p) === 'completed').length})
                    </button>
                </div>
            </div>

            {filteredProjects.length === 0 ? (
                <div className="no-projects">
                    <p>No projects found.</p>
                    {projects.length === 0 ? (
                        <button onClick={onCreateProject} className="btn-create-first">
                            Create Your First Project
                        </button>
                    ) : null}
                </div>
            ) : (
                <div className="projects-grid">
                    {filteredProjects.map(project => (
                        <div key={project.id} className="project-card">
                            <div className="project-header">
                                <div className="project-type-and-status">
                                    <h3>{project.projectType}</h3>
                                    {getStatusBadge(project)}
                                </div>
                            </div>

                            <div className="project-details">
                                <div className="detail-row">
                                    <span className="detail-label">Duration:</span>
                                    <span className="detail-value">
                                        {formatDate(project.startDate)} - {formatDate(project.endDate)}
                                    </span>
                                </div>

                                {project.projectBudget && (
                                    <div className="detail-row">
                                        <span className="detail-label">Budget:</span>
                                        <span className="detail-value">{formatCurrency(project.projectBudget)}</span>
                                    </div>
                                )}

                                {project.perHourRate && (
                                    <div className="detail-row">
                                        <span className="detail-label">Hourly Rate:</span>
                                        <span className="detail-value">{formatCurrency(project.perHourRate)}</span>
                                    </div>
                                )}

                                {project.perDayRate && (
                                    <div className="detail-row">
                                        <span className="detail-label">Daily Rate:</span>
                                        <span className="detail-value">{formatCurrency(project.perDayRate)}</span>
                                    </div>
                                )}

                                {project.projectDescription && (
                                    <div className="project-description">
                                        <span className="detail-label">Description:</span>
                                        <p>{project.projectDescription}</p>
                                    </div>
                                )}
                            </div>

                            <div className="project-actions">
                                <button
                                    onClick={() => onUpdateProject(project)}
                                    className="btn-update"
                                >
                                    Update
                                </button>
                                <button
                                    onClick={() => onDeleteProject(project.id)}
                                    className="btn-delete"
                                >
                                    Delete
                                </button>
                            </div>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
};

export default ProjectList;
